   <line></line>\n        <line>\n            <text align =\"left\" bold=\"true\" length=\"32\">Payments</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">Amount</text>\n        </line>\n        <line><text>------------------------------------------</text></line> \n        #foreach ($line in $payments.getPaymentLines())\n        <line>\n            <text align =\"left\" length=\"32\">${line.printType()}${line.printReason()}</text>\n            <text align =\"right\" length=\"10\">${line.printValue()}</text>\n        </line> \n        #end\n        <line><text>------------------------------------------</text></line> \n        <line>\n            <text align =\"left\" length=\"32\" bold=\"true\">Total</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">${payments.printPaymentsTotal()}</text>\n        </line>\n        <line>\n            <text align =\"left\" length=\"22\">Number of Payments:</text>\n            <text align =\"right\" length=\"10\">${payments.printPayments()}</text>\n        </line>        \n        <line></line>\n        <line>\n            <text align =\"left\" length=\"32\" bold=\"true\">Tax Analysis</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">Amount</text>\n        </line>\n        <line><text>------------------------------------------</text></line>\n        #foreach ($line in $payments.getSaleLines())\n        <line>\n            <text align =\"left\" length=\"32\">${line.printTaxName()}</text>\n            <text align =\"right\" length=\"10\">${line.printTaxes()}</text>\n        </line> \n        #end        \n        <line><text>------------------------------------------</text></line>\n        <line>\n            <text align =\"left\" bold=\"true\" length=\"32\">Total</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">${payments.printSalesTaxes()}</text>\n        </line>        \n\n        <line></line>\n        <line>\n            <text align =\"left\" bold=\"true\" length=\"42\">Product Category Sales</text>\n        </line>\n        <line>\n            <text align =\"left\" bold=\"true\" length=\"22\">Name</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">Qty</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">Amount</text>\n        </line>\n        <line>\n            <text>------------------------------------------</text>\n        </line>\n        #foreach ($line in $payments.getCategorySalesLines())\n        <line>\n            <text align =\"left\" length=\"22\">${line.printCategoryName()}</text>\n            <text align =\"right\" length=\"10\">${line.printCategoryUnits()}</text>\n            <text align =\"right\" length=\"10\">${line.printCategorySum()}</text>\n        </line>\n        #end\n        <line><text>------------------------------------------</text></line>\n        <line>\n            <text align =\"left\" bold=\"true\" length=\"22\">Total</text>\n            <text align =\"right\" length=\"10\">${payments.printCategorySalesTotalUnits()}</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">${payments.printCategorySalesTotal()}</text>\n        </line>\n        <line></line>\n        <line>\n            <text align =\"left\" length=\"22\">Ticket Lines:</text>\n            <text align =\"right\" length=\"10\">${payments.printCategorySalesRows()}</text>\n        </line>\n\n        <line>\n            <text align =\"left\" length=\"22\">Receipts:</text>\n            <text align =\"right\" length=\"10\">${payments.printSales()}</text>\n        </line>                \n        <line><text>------------------------------------------</text></line>\n\n        <line></line>\n        <line size=\"1\">\n            <text align =\"left\" bold=\"true\" length=\"32\">Subtotal</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">${payments.printSalesBase()}</text>\n        </line>\n        <line size=\"1\">\n            <text align =\"left\" bold=\"true\" length=\"32\">Taxes</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">${payments.printSalesTaxes()}</text>\n        </line>\n        <line size=\"1\">\n            <text align =\"left\" bold=\"true\" length=\"32\">Total</text>\n            <text align =\"right\" bold=\"true\" length=\"10\">${payments.printSalesTotal()}</text>\n        </line>        \n        <line><text>------------------------------------------</text></line>\n        <line>\n            <text length=\"18\">Machine:</text>\n            <text>${payments.printHost()}</text>\n        </line>    \n        <line>\n            <text length=\"18\">Sequence:</text>\n            <text>${payments.printSequence()}</text>\n        </line> \n        <line>\n            <text length=\"18\">Start Date:</text>\n            <text>${payments.printDateStart()}</text>\n        </line>  \n        <line>\n            <text length=\"18\">End Date:</text>\n            <text>${payments.printDateEnd()}</text>\n        </line>  \n    </ticket>\n</output>\n'),('32','Printer.Product',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<output>\n    <ticket>\n        <image>Printer.Ticket.Logo</image>\n        <line>\n            <text align=\"center\" length=\"42\">N.I.F. 00.000.000 X</text>\n        </line>\n        <line size=\"1\">\n            <text align =\"center\" length=\"42\" bold=\"true\">${product.printName()}</text>\n        </line>\n        <line></line>\n        <line size=\"3\">\n            <text>Eur.</text>\n            <text align =\"right\" length=\"6\">${product.printPriceEur()}</text>\n        </line>\n        <line size=\"2\">\n            <text>Pts.</text>\n            <text align =\"right\" length=\"6\">${product.printPricePts()}</text>\n        </line>\n        <barcode type=\"EAN13\">${product.printCode()}</barcode>        \n    </ticket>\n</output>'),('33','Printer.Start',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n\n<output>\n    <display animation=\"scroll\">\n        <line>\n            <text>uniCenta oPOS</text>\n        </line>\n        <line>\n            <text>   Touch Friendly Point Of Sale   </text>\n        </line>\n    </display>\n</output>\n'),('34','Printer.Ticket',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!-- \r\n    uniCenta oPOS - Touch friendly Point Of Sale\r\n    Copyright (c) 2009-2013 uniCenta.\r\n    http://sourceforge.net/projects/unicentaopos\r\n\r\n    This file is part of uniCenta oPOS.\r\n\r\n    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n    it under the terms of the GNU General Public License as published by\r\n    the Free Software Foundation, either version 3 of the License, or\r\n    (at your option) any later version.\r\n\r\n    uniCenta oPOS is distributed in the hope that it will be useful,\r\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n    GNU General Public License for more details.\r\n\r\n    You should have received a copy of the GNU General Public License\r\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n -->\r\n\r\n<output>\r\n\r\n<display>\r\n	<line><text align=\"left\" length=\"10\">Total</text><text align=\"right\" length=\"10\">${ticket.printTotal()}</text></line>\r\n	<line><text align=\"center\" length=\"20\">Thank you for your custom</text></line>\r\n</display>\r\n\r\n<ticket>\r\n	<image>Printer.Ticket.Logo</image>\r\n	<line></line>\r\n\r\n	<line><text align=\"center\" length=\"42\">uniCenta oPOS</text></line>\r\n	<line><text align=\"center\" length=\"42\">Touch Friendly Point Of Sale</text></line>\r\n	<line><text align=\"center\" length=\"42\">Copyright (c) 2009-2013 uniCenta</text></line>\r\n	<line><text align=\"center\" length=\"42\">Printer.Ticket</text></line>\r\n	<line></line>\r\n\r\n	#if (${ticket.ticketType} == 0)\r\n		<line><text align=\"left\" length=\"15\">Receipt:</text><text>${ticket.printId()}</text></line>\r\n	#end\r\n\r\n	#if (${ticket.ticketType} == 1)\r\n		<line><text align=\"left\" length=\"15\">Refund:</text><text>${ticket.printId()}</text></line>\r\n	#end\r\n		<line><text align=\"left\" length=\"15\">Date:</text><text>${ticket.printDate()}</text></line>\r\n\r\n	#if ($ticket.getCustomer())\r\n		<line><text align=\"left\" length=\"15\">Customer:</text><text>${ticket.getCustomer().printName()}</text></line>\r\n		<line><text align=\"left\" length=\"15\">Account #:</text><text>${ticket.getCustomer().printTaxid()}</text></line>\r\n		<line><text align=\"left\" length=\"15\">Current Debt:</text><text>${ticket.getCustomer().printCurDebt()}</text></line>\r\n	#end\r\n\r\n	#if (${tickettext.place} != ${place})\r\n		<line><text align=\"left\" length=\"15\">Table:</text><text>${place}</text></line>\r\n	#end\r\n        \r\n		<line><text align=\"left\" length=\"15\">Served by:</text><text>${ticket.printUser()}</text></line>\r\n		<line></line>\r\n		<line><text align =\"left\" length=\"17\">Item</text><text align =\"right\" length=\"8\">Price</text><text align =\"right\" length=\"7\">Qty</text><text align =\"right\" length=\"10\">Value</text></line>\r\n		<line><text align=\"left\" length=\"42\">------------------------------------------</text></line>\r\n#foreach ($ticketline in $ticket.getLines())\r\n	<line>\r\n	\r\n	#if ($ticketline.isProductCom())\r\n		<text align =\"left\" length=\"17\">*${ticketline.printName()}</text>\r\n	#else\r\n		<text align =\"left\" length=\"17\">${ticketline.printName()}</text>\r\n	#end\r\n		<text align =\"right\" length=\"8\">${ticketline.printPriceTax()}</text>\r\n		<text align =\"right\" length=\"7\">x${ticketline.printMultiply()}</text>\r\n		<text align =\"right\" length=\"10\">${ticketline.printValue()}</text>\r\n	</line>\r\n\r\n	#if ($ticketline.productAttSetInstId)\r\n		<line><text align =\"left\" length=\"42\">${ticketline.productAttSetInstDesc}</text></line>\r\n	#end\r\n#end\r\n	<line><text align=\"left\" length=\"42\">------------------------------------------</text></line>\r\n	<line><text>Items count: </text><text align =\"left\" length=\"14\">${ticket.printArticlesCount()}</text></line>\r\n	<line></line>\r\n	<line size=\"1\"><text align =\"left\" length=\"16\" bold=\"true\">Total</text><text align =\"right\" length=\"26\" bold=\"true\">${ticket.printTotal()}</text></line>\r\n\r\n#foreach ($paymentline in $ticket.payments)\r\n\r\n	#if ($paymentline.name == \"cash\")\r\n		<line><text bold=\"true\">Cash</text></line>\r\n                <line><text align=\"left\" length=\"22\">Tendered:</text><text align =\"right\" length=\"20\">${paymentline.printPaid()}</text></line> -->\r\n	        <line><text align=\"left\" length=\"22\">Change:</text><text align =\"right\" length=\"20\">${paymentline.printChange()}</text></line>\r\n	#end\r\n          	\r\n	#if ($paymentline.name == \"cashrefund\")\r\n            		<line><text bold=\"true\">Refund</text></line>\r\n		<line><text align =\"right\" length=\"42\">${paymentline.printTotal()}</text></line>\r\n	#end\r\n	\r\n	#if ($paymentline.name == \"magcard\")\r\n		<line><text bold=\"true\">Card</text></line>\r\n                <line> <text>Card Type</text></line>\r\n                <line> \r\n                    <text>${paymentline.getCardName()}</text> \r\n                </line>                 \r\n		<line><text align =\"right\" length=\"42\">${paymentline.printTotal()}</text></line>\r\n	#end\r\n\r\n	#if ($paymentline.name == \"magcardrefund\")\r\n		<line><text bold=\"true\">Card Refund</text></line>\r\n                <line> <text>Card Type</text></line>\r\n                <line> \r\n                    <text>${paymentline.getCardName()}</text> \r\n                </line>                 \r\n		<line><text align =\"right\" length=\"42\">${paymentline.printTotal()}</text></line>\r\n	#end\r\n\r\n	#if ($paymentline.name == \"cheque\")\r\n		<line></line>\r\n		<line><text bold=\"true\">Cheque</text></line>\r\n		<line><text align =\"right\" length=\"42\">${paymentline.printTotal()}</text></line>\r\n	#end\r\n\r\n	#if ($paymentline.name == \"chequerefund\")\r\n		<line></line>\r\n		<line><text bold=\"true\">Cheque Refund</text></line>\r\n		<line><text align =\"right\" length=\"42\">${paymentline.printTotal()}</text></line>\r\n	#end\r\n\r\n	#if ($paymentline.name == \"paperin\")\r\n		<line></line>\r\n		<line><text bold=\"true\">Note</text></line>\r\n		<line><text align =\"right\" length=\"42\">${paymentline.printTotal()}</text></line>\r\n	#end\r\n\r\n	#if ($paymentline.name == \"paperout\")\r\n		<line></line>\r\n		<line><text bold=\"true\">Note Refund</text></line>\r\n		<line><text align =\"right\" length=\"42\">${paymentline.printTotal()}</text></line>\r\n	#end\r\n\r\n	#if ($paymentline.name == \"free\")\r\n		<line></line>\r\n		<line><text bold=\"true\">Free</text></line>\r\n		<line><text align =\"right\" length=\"42\">${paymentline.printTotal()}</text></line>\r\n	#end\r\n	\r\n	#if ($paymentline.name == \"debt\")\r\n		<line></line>\r\n		<line><text bold=\"true\">On Account</text></line>\r\n		<line><text align =\"right\" length=\"42\">${paymentline.printTotal()}</text></line>\r\n	#end\r\n#end\r\n\r\n	<line></line>\r\n	<line><text align =\"left\" bold=\"true\" length=\"16\">Nett of Tax:</text><text align =\"right\" length=\"26\">${ticket.printSubTotal()}</text></line>\r\n	<line><text align =\"left\" length=\"16\">Taxes:</text><text align =\"right\" length=\"26\">${ticket.printTax()}</text></line>\r\n	<line></line>\r\n\r\n#foreach ($taxinfo in $taxes)\r\n<!--        #set( $taxline = $ticket.getTaxLine($taxinfo)) -->\r\n        <line>\r\n            <text align =\"left\" length=\"18\">${taxline.getTaxInfo()}</text>\r\n            <text align =\"right\" length=\"12\">${taxline.printSubTotal()}</text>\r\n            <text align =\"right\" length=\"12\">${taxline.printTax()}</text>\r\n        </line>\r\n#end\r\n\r\n	<line></line>\r\n	<line><text align=\"center\" length=\"42\">Thank you for your custom</text></line>\r\n	<line><text align=\"center\" length=\"42\">Please Call Again</text></line>\r\n\r\n</ticket>\r\n\r\n#foreach ($paymentline in $ticket.payments)\r\n	#if ($paymentline.name == \"cash\")\r\n		<opendrawer/>\r\n	#end\r\n	#if ($paymentline.name == \"cashrefund\")\r\n		<opendrawer/>\r\n	#end\r\n#end\r\n\r\n</output>'),('35','Printer.Ticket2',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<output>\n    <display>\n        <line>\n            <text align=\"left\" length=\"10\">Total:</text>\n            <text align=\"right\" length=\"10\">${ticket.printTotal()}</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"20\">Thank You for your custom</text>\n        </line>\n    </display>\n    #foreach ($paymentline in $ticket.payments)      \n     #if ($paymentline.name == \"cash\")\n    <opendrawer/>\n     #end\n     #if ($paymentline.name == \"cashrefund\")\n    <opendrawer/>\n     #end  \n    #end\n</output>'),('36','Printer.TicketClose',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n	\n    This displays amount tendered and change on customer display\n\n -->\n<output>   \n    <display>\n    #foreach ($paymentline in $ticket.payments)\n            <line>\n              <text align=\"left\" length=\"10\">Tendered:</text>\n              <text align =\"right\" length=\"10\">${paymentline.printPaid()}</text>\n            </line>\n            <line>\n              <text align=\"left\" length=\"10\">Change:</text>\n              <text align =\"right\" length=\"10\">${paymentline.printChange()}</text>\n            </line>\n    #end\n    </display>\n</output>\n'),('37','Printer.TicketKitchen',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!--\n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n-->\n\n<output>\n\n    <display>\n        <line>\n            <text align=\"left\" length=\"10\">Order sent to Remote Printer</text>\n            <text align=\"right\" length=\"10\">${ticket.printTotal()}</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"20\">Thank you.</text>\n        </line>\n    </display>\n\n    <ticket printer = \"2\">\n        <line></line>\n        <line></line>\n        <line size = \"1\">\n            <text bold = \"true\" align=\"center\" length=\"42\">Remote Print Order</text>\n        </line>\n        <line></line>\n        <line>\n            <text align=\"left\" length=\"15\">Receipt:</text>\n            <text>${ticket.printId()}</text>\n        </line>\n        <line>\n            <text align=\"left\" length=\"15\">Date:</text>\n            <text>${ticket.printDate()}</text>\n        </line>\n\n    #if ($ticket.getCustomer())\n        <line>\n            <text align=\"left\" length=\"15\">Customer:</text>\n            <text>${ticket.getCustomer().getName()}</text>\n        </line>\n        <line>\n            <text align=\"left\" length=\"15\"></text>\n            <text align=\"left\" length=\"15\">Account #:</text>\n            <text>${ticket.getCustomer().getTaxid()}</text>\n        </line>\n    #end\n\n    #if (${tickettext.place} != ${place})\n        <line>\n           <text align=\"left\" length=\"15\">Table:</text>\n           <text>${place}</text>\n        </line>\n    #end\n        \n        <line></line>\n        <line>\n            <text align =\"left\" length=\"17\">Item</text>\n            <text align =\"right\" length=\"5\"></text>\n        </line>\n        <line>\n            <text>------------------------------------------</text>\n        </line>\n    #foreach ($ticketline in $ticket.getLines())\n        #if(($ticketline.isProductKitchen()) && ($ticketline.getProperty(\"sendstatus\").equals(\"No\")))\n            <line size = \"1\">\n                <text align =\"left\" length=\"5\">${ticketline.printMultiply()}x</text>\n                #if ($ticketline.isProductCom())\n                    <text align =\"left\" length=\"37\">--${ticketline.printName()}</text>\n                #else\n                    <text align =\"left\" length=\"37\">${ticketline.printName()}</text>\n                #end\n            </line>\n        #end\n<!-- Add the following lines only for 2.30 Attributes -->\n        #if ($ticketline.productAttSetInstId)\n            <line>\n                <text align =\"left\" length=\"42\">    ${ticketline.productAttSetInstDesc}</text>\n            </line>\n        #end\n<!-- Add the previous lines only for 2.30 Attributes -->\n    #end\n        <line>\n            <text>------------------------------------------</text>\n        </line>\n        <line>\n            <text align=\"left\" length=\"15\">Cashier:</text>\n            <text>${ticket.printUser()}</text>\n        </line>\n    </ticket>\n</output>\n'),('38','Printer.TicketLine',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<output>\n    <display>\n        <line>\n            #if ($ticketline.isProductCom()) \n                <text align=\"left\" length=\"15\">*${ticketline.printName()}</text>\n            #else\n                 <text align=\"left\" length=\"15\">${ticketline.printName()}</text>\n            #end\n            <text align=\"right\" length=\"5\">x${ticketline.printMultiply()}</text>\n        </line>\n        <line>\n            <text align=\"right\" length=\"10\">${ticketline.printPrice()}</text>\n            <text align=\"right\" length=\"10\">${ticketline.printSubValue()}</text>\n        </line>\n    </display>\n</output>'),('39','Printer.TicketNew',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<output>\n    <display>\n        <line>\n            #if ($ticketline.isProductCom()) \n                <text align=\"left\" length=\"15\">*${ticketline.printName()}</text>\n            #else\n                 <text align=\"left\" length=\"15\">${ticketline.printName()}</text>\n            #end\n            <text align=\"right\" length=\"5\">x${ticketline.printMultiply()}</text>\n        </line>\n        <line>\n            <text align=\"right\" length=\"10\">${ticketline.printPrice()}</text>\n            <text align=\"right\" length=\"10\">${ticketline.printSubValue()}</text>