 = new DataLogicSales();\r\nlogicsale.init(session);\r\nDataLogicSystem logicsystem = new DataLogicSystem();\r\nlogicsystem.init(session);\r\nProperties p = logicsystem.getResourceAsProperties(hostname + \"/properties\");\r\nString loc = p.getProperty(\"location\");\r\n \r\nproduct = line.getProductID();\r\nunits = logicsale.findProductStock(loc,product,null);\r\nmultiply = 0;\r\n \r\nif (line.isProductService() == true) {\r\n    javax.swing.JOptionPane.showMessageDialog(null, \"This is a Service and Stock Level is not checked\", \"Stock Check\", JOptionPane.WARNING_MESSAGE);\r\n} else {\r\n    \r\n    for (int i= 0; i < ticket.getLinesCount(); i++) {\r\n        row = ticket.getLine(i);\r\n        if (row.getProductID() == product) {\r\n            multiply = multiply + row.getMultiply();\r\n        }\r\n    }\r\n    diff = units - line.getMultiply() - multiply;\r\n        if (diff < 0.0) {\r\n            javax.swing.JOptionPane.showMessageDialog(null, \"Not enough stock at this Location \" + loc + \" - Use Stock Diary to Add Stock to Inventory\", \"Stock Check\", JOptionPane.WARNING_MESSAGE);\r\n	    return \"Cancel\";\r\n	 } else {\r\n	    return null;\r\n	 }\r\n }'),('52','script.StockCurrentSet',0,'// script.StockCurrentSet\r\n// This script checks Stock Level for a sale item\r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2013 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n \r\n import com.openbravo.pos.forms.DataLogicSales;\r\n import com.openbravo.pos.forms.DataLogicSystem;\r\n import com.openbravo.data.loader.Session;\r\n import java.util.Properties;\r\n \r\n Session session = new Session(dbURL, dbUser, dbPassword);\r\n DataLogicSales logicsale = new DataLogicSales();\r\n logicsale.init(session);\r\n DataLogicSystem logicsystem = new DataLogicSystem();\r\n logicsystem.init(session);\r\n Properties p = logicsystem.getResourceAsProperties(hostname + \"/properties\");\r\n String loc = p.getProperty(\"location\");\r\n \r\n product = line.getProductID();\r\n isserv = line.isProductService();\r\n units = logicsale.findProductStock(loc,product,null);\r\n multiply = 0;\r\n index = sales.getSelectedIndex();\r\n \r\n  if (line.isProductService() == true) {\r\n	javax.swing.JOptionPane.showMessageDialog(null, \"This is a Service and Stock Level is not checked\");\r\n  } else {\r\n\r\n	 if (index != -1) {\r\n	     currentrow = ticket.getLine(index);\r\n	     multiply = multiply - currentrow.getMultiply();\r\n	 }\r\n	 for (int i= 0; i < ticket.getLinesCount(); i++) {\r\n	     row = ticket.getLine(i);\r\n	     if (row.getProductID() == product) {\r\n	        multiply = multiply + row.getMultiply();\r\n	     }\r\n	 }\r\n	 diff = units - line.getMultiply() - multiply;\r\n	 if (diff < 0.0) {\r\n	    javax.swing.JOptionPane.showMessageDialog(null, \"Not enough stock at this Location \" + loc + \" - Please use Stock Diary to Add Stock to Inventory\", \"Stock\", JOptionPane.WARNING_MESSAGE);\r\n	    return \"Cancel\";\r\n	 } else {\r\n	         return null;\r\n	 }\r\n }'),('53','script.totaldiscount',0,'// script.totaldiscount\n// This script applies UsersInput% Discount for the Total Receipt value\n//\n//    uniCenta oPOS - Touch Friendly Point Of Sale\n//    Copyright (c) 2009-2013 uniCenta\n//    http://sourceforge.net/projects/unicentaopos\n//\n//    This file is part of uniCenta oPOS.\n//\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\n//    it under the terms of the GNU General Public License as published by\n//    the Free Software Foundation, either version 3 of the License, or\n//    (at your option) any later version.\n//\n//    uniCenta oPOS is distributed in the hope that it will be useful,\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n//    GNU General Public License for more details.\n//\n//    You should have received a copy of the GNU General Public License\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n// **************************************************************************\n// This script applies UsersInput% Discount for the Total Receipt value\n\nimport com.openbravo.format.Formats;\nimport com.openbravo.pos.ticket.TicketLineInfo;\nimport com.openbravo.pos.ticket.TicketProductInfo; \n\ndiscountrate = 1 - (sales.getInputValue() / 100.0);\n\nindex = sales.getSelectedIndex();\nif (index >= 0) {\n    if (ticket.getTotal() > 0.0 && discountrate > 0.0) {\n \n        sdiscount = Formats.PERCENT.formatValue((1-discountrate));\n\nfor (int number= 0; number < ticket.getLinesCount(); number++) {\n\n    line = ticket.getLine(number);\n        ticket.setLine(number,\n            new TicketLineInfo(\n                    line.getProductID(),\n                    line.getProductName() + \" -\" + sdiscount,\n                    line.getProductTaxCategoryID(),\n                    line.getMultiply(),\n                    (double)Math.round(line.getPrice() * discountrate * 100) / 100,\n                    line.getTaxInfo()));\n    }  \n} else {  \n    java.awt.Toolkit.getDefaultToolkit().beep();  \n}\n} else {\n    java.awt.Toolkit.getDefaultToolkit().beep();\n}'),('54','Ticket.Buttons',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n \n<!-- To ENABLE a feature remove the beginning and of line commentors -->\n<!-- To DISABLE a feature you must add the beginning and of line commentors -->\n\n<configuration>\n<!-- Sales Ticket Button Bar - Show icons **************************************** -->\n	<!-- SET Sales Ticket Refund Item (Default=DISABLED) -->\n	<!-- <button key=\"button.refundit\" image=\"img.refundit\" code=\"script.Refundit\"/> -->\n\n	<!-- SET Sales Ticket ServiceCharge (Default=DISABLED) -->\n	<!-- <button key=\"button.scharge\" image=\"img.heart\" code=\"script.ServiceCharge\"/> -->\n                \n	<!-- SET Line or Total Discount (Default=TotalDiscount= DISABLED) -->\n	<!-- <button key=\"button.totaldiscount\" image=\"img.discount\" code=\"script.totaldiscount\"/> -->\n	<!-- <button key=\"button.linediscount\" image=\"img.discount\" code=\"script.linediscount\"/>  -->\n\n	<!-- SET Waiter\'s name (Default=DISABLED) -->\n	<!-- <button key=\"button.setperson\" image=\"img.user\" code=\"script.SetPerson\"/>  -->\n\n	<!-- SET Remote Printer (Default=DISABLED) Not required for John L changes--> \n	<!-- <button key=\"button.sendorder\" image=\"img.kit_print\" code=\"script.SendOrder\"/>  -->\n\n	<!-- SET Ticket Print Preview (Default=ENABLED) -->\n    	<button key=\"button.print\" image=\"img.ticket_print\" template=\"Printer.TicketPreview\"/>\n\n	<!-- SET Open Cashdrawer (Default=ENABLED) -->\n	<button key=\"button.opendrawer\" image=\"img.cashdrawer\" template=\"Printer.OpenDrawer\"/>\n        \n<!-- END Sales Ticket Button Bar - Show icons -->\n\n<!-- SET Ticket Button Bar - Text Only ****************************************************************** -->\n	<!-- <button key=\"button.refundit\" name=\"button.refundit\" code=\"script.Refundit\"/> -->\n    	<!-- <button key=\"button.linediscount\" name=\"button.linediscount\" code=\"script.linediscount\"/> -->\n    	<!-- <button key=\"button.discount\" name=\"button.totaldiscount\" code=\"script.totaldiscount\"/> -->\n    	<!-- <button key=\"button.setperson\" name=\"button.setperson\" code=\"script.SetPerson\"/> -->\n    	<!-- <button key=\"button.sendorder\" name=\"button.sendorder\" code=\"script.SendOrder\"/> -->\n    	<!-- <button key=\"button.print\" titlekey=\"button.print\" template=\"Printer.TicketPreview\"/> -->\n    	<!-- <button key=\"button.opendrawer\" titlekey=\"button.opendrawer\" template=\"Printer.OpenDrawer\"/> -->\n<!-- END Ticket Button Bar - Text Only -->\n\n<!-- SET Product Area Size ********************************************* -->\n	<!-- Maximum Category height for 800x480 for PDA in Full Screen mode -->\n	<!-- <cat-height value=\"100\" /> -->\n\n	<!-- Maximum Category height for 800x600 -->\n	<!--  <cat-height value=\"155\" /> -->\n\n	<!-- Maximum Category height for 1024x768 in Full Screen mode (Default=ENABLED) -->\n	<cat-height value=\"320\" />\n\n	<!-- Maximum Category height for 1280x1024 in Full Screen mode -->\n	<!--  <cat-height value=\"640\" /> -->\n<!-- END Product Area Size -->\n\n<!-- SET Product Button Sizes ****************************************** -->\n	<!-- Small Product button size in Sales screen (Default=DISABLED) -->\n	<!--  <img-width value=\"64\"/> -->\n	<!--  <img-height value=\"48\"/> -->\n\n	<!-- Medium Product button size in Sales screen (Default=ENABLED) -->\n   	<img-width value=\"96\"/>\n	<img-height value=\"72\"/>\n    \n<!-- Large Product button size in Sales screen (Default=DISABLED)-->\n	<!-- <img-width value=\"128\"/> -->\n	<!-- <img-height value=\"96\"/> -->\n<!-- END Product Button Size -->\n\n<!-- Print Receipt (Default=ENABLED) -->\n        <printselected value=\"true\"/>\n\n<!-- ADDITIONAL FEATURES ************************************************* -->\n	<!-- SET Show Change in Cash Sale (Default=ENABLED -->\n	<event key=\"ticket.close\" code=\"Ticket.Close\"/>\n\n	<!-- SET Consolidate Receipt - Multiple ProductID\'s (Default=ENABLED) -->\n	<event  key=\"ticket.total\" code=\"script.ReceiptConsolidate\"/>\n\n	<!-- SET Stock Level Checking (Default=DISABLED) --> \n	<!-- <event key=\"ticket.addline\" code=\"script.StockCurrentAdd\"/> -->\n	<!-- <event key=\"ticket.setline\" code=\"script.StockCurrentSet\"/> -->\n\n    <event key=\"ticket.change\" code=\"event.change\"/>\n    <event key=\"ticket.addline\" code=\"event.addline\"/>\n    <event key=\"ticket.removeline\" code=\"event.removeline\"/>\n    <event key=\"ticket.setline\" code=\"event.setline\"/>\n	<!-- <event key=\"ticket.show\" code=\"event.show\"/> -->\n	<!-- <event key=\"ticket.total\" code=\"script.Event.Total\"/> -->\n\n            <!-- <taxesincluded value=\"true\"/> -->\n            <!-- <taxcategoryid value=\"001\"/> -->\n            <!-- <pricevisible value=\"true\" /> -->\n\n</configuration>'),('55','Ticket.Close',0,'//    uniCenta oPOS - Touch Friendly Point Of Sale\n//    Copyright (c) 2009-2013 uniCenta\n//    http://sourceforge.net/projects/unicentaopos\n//\n//    This file is part of uniCenta oPOS.\n//\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\n//    it under the terms of the GNU General Public License as published by\n//    the Free Software Foundation, either version 3 of the License, or\n//    (at your option) any later version.\n//\n//    uniCenta oPOS is distributed in the hope that it will be useful,\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n//    GNU General Public License for more details.\n//\n//    You should have received a copy of the GNU General Public License\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n// **************************************************************************\n// Ticket.Close\n// This script displays the amount of Cash Change (CashTendered - TicketValue) to be given to Customer\n\nimport com.openbravo.pos.payment.PaymentInfo;\nimport javax.swing.JOptionPane;\n\nboolean isCash = false;\nString paid = \"\";\nString change = \"\";\nPaymentInfo p = ticket.payments.getFirst();\n\nJLabel FontText = new JLabel();\n\nFontText.setFont (new Font ( \"Arial\", Font.BOLD, 32) );\n\nif (\"cash\".equals(p.getName())) {\n	isCash = true;\n        paid = p.printPaid();\n	change = p.printChange();\n}\n\nif(isCash) {\n	FontText.setText(\"Return: \" + change);\n	JOptionPane.showMessageDialog (null,\n	FontText,\n	\"Change\", \n	JOptionPane.WARNING_MESSAGE);\n}\n'),('56','Ticket.Discount',0,'import com.openbravo.format.Formats;\nimport com.openbravo.pos.ticket.TicketLineInfo;\nimport com.openbravo.pos.ticket.TicketProductInfo;\n\ndiscountrate = 1 - (sales.getInputValue() / 100.0);\n\nindex = sales.getSelectedIndex();\nif (index >= 0) {\n    line = ticket.getLine(index);\n    if (line.getPrice() > 0.0 && discountrate > 0.0) {\n        sdiscount = Formats.PERCENT.formatValue((1-discountrate));\n        ticket.setLine(index,\n            new TicketLineInfo(\n                    line.getProductID(),\n                    line.getProductName() + \" -\" + sdiscount,\n                    line.getProductTaxCategoryID(),\n                    line.getMultiply(),\n                    line.getPrice () * discountrate,\n                    line.getTaxInfo()));\n        sales.setSelectedIndex(index);\n    } else {\n         java.awt.Toolkit.getDefaultToolkit().beep();\n    }\n} else {\n    java.awt.Toolkit.getDefaultToolkit().beep();\n}\n'),('57','Ticket.Line',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!--\n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n\n<!-- This sales transaction screen is great for Retailers! -->\n<line>\n    <column name=\"label.item\" width=\"185\" align=\"left\" value=\"&lt;html&gt;#if ($ticketline.isProductCom()) &lt;i&gt;*&amp;nbsp;&amp;nbsp;${ticketline.printName()}&lt;/i&gt; #else ${ticketline.printName()} #end&lt;br&gt;${ticketline.getProductAttSetInstDesc()}\"/>\n    <column name=\"label.price\" width=\"50\" align=\"right\" value=\"${ticketline.printPrice()}\"/>\n    <column name=\"label.units\" width=\"50\" align=\"right\" value=\"x${ticketline.printMultiply()}\"/>\n    <column name=\"label.tax\" width=\"50\" align=\"right\" value=\"${ticketline.printTaxRate()}\"/>\n    <column name=\"label.value\" width=\"100\" align=\"right\" value=\"${ticketline.printValue()}\"/>\n</line>\n\n<!-- This sales transaction screen is great for Hospitality!\n<line>\n    <column name=\"label.item2\" width=\"335\" align=\"left\" value=\"&lt;html&gt;#if ($ticketline.isProductCom()) &lt;i&gt;*&amp;nbsp;&amp;nbsp;${ticketline.printName()}&lt;/i&gt; #else ${ticketline.printName()} #end&lt;br&gt;${ticketline.getProductAttSetInstDesc()}\"/>\n    <column name=\"label.units2\" width=\"50\" align=\"right\" value=\"x${ticketline.printMultiply()}\"/>\n    <column name=\"label.value2\" width=\"50\" align=\"right\" value=\"${ticketline.printValue()}\"/>\n</line>\n -->'),('58','Ticket.TicketLineTaxesIncluded',0,'<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2013 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n\n<line>\n    <column name=\"label.item\" width=\"125\" align=\"left\" value=\"&lt;html&gt;#if ($ticketline.isProductCom()) &lt;i&gt;*&amp;nbsp;&amp;nbsp;${ticketline.printName()}&lt;/i&gt; #else ${ticketline.printName()} #end\"/>\n    <column name=\"label.price\" width=\"80\" align=\"right\" value=\"${ticketline.printPric